import {React, useEffect, useState} from 'react'
import {NavbarItem, Blog} from '../components'
import { getBlogs } from '../services/blogservice'
const Landing = () => {
  const [blogs, setBlogs] = useState([])

useEffect(() => {loadBlogs()})

const loadBlogs = async () => {
  const blogsLoaded = await getBlogs()
  setBlogs(blogsLoaded)
}
  return (
    <>
    <NavbarItem />
    {
      blogs.map((blog, index)=>{
        return <Blog heading={blog.heading} key={index} />
      })
    }
    </>
  )
}

export default Landing
